import React from 'react';
import {Nav, NavbarContainer , NavLogo} from './NavElements';

const Navbar = () => {
    return (
       <>
        <Nav>
            <NavbarContainer>
                <NavLogo to ='/'>
                    XFACE
                </NavLogo>
                <h1>Hey THERE</h1>
            </NavbarContainer>
        </Nav>
       </>
    )
}

export default Navbar
